  {
    id: 'p2',
    poke_name: 'Totodile',
    image: 'https://archives.bulbagarden.net/media/upload/d/df/158Totodile.png',
    type: 'Water',
    description: '2nd Gen water starter'
  }
];




function CreateTeamPage(){
  return (
    <div>
      <h1>Create Team Page</h1>
      <h3>Choose your Pokemon!</h3>
      <PokemonList pokemons={SAMPLE_POKEMON} />
    </div>
  );
}

export default CreateTeamPage;
